77.source:
function createCircle(x, y, bodyType) {
    var b2Vec2 = Box2D.Common.Math.b2Vec2
        , b2BodyDef = Box2D.Dynamics.b2BodyDef
        , b2FixtureDef = Box2D.Dynamics.b2FixtureDef
        , b2CircleShape = Box2D.Collision.Shapes.b2CircleShape;

    var fixDef = new b2FixtureDef;
    fixDef.density = 1.0;
    fixDef.friction = 0.5;
    fixDef.restitution = 0.2;
    var bodyDef = new b2BodyDef;
    var radius = 0.1;
    bodyDef.type = bodyType;  
    fixDef.shape = new b2CircleShape(radius);
    bodyDef.position.x = x;
    bodyDef.position.y = y;
    var a = this.box2dWorld.CreateBody(bodyDef);
    a.CreateFixture(fixDef);
    return a;    
}

80.source:
function makeTree(prevLevel, levels) {
    if (levels <= 0) return;
    var curLevel = [];
    var   b2BodyDef = Box2D.Dynamics.b2BodyDef
        , b2Body = Box2D.Dynamics.b2Body;
    for (var j = 0; j < levels; j++){
        for(var i = 0; i < prevLevel.length; i++){
            if (i === 0)
                curLevel.push(this.createCircle(prevLevel[i].GetPosition().x - 0.4, prevLevel[i].GetPosition().y + 0.4, b2Body.b2_staticBody));
            curLevel.push(this.createCircle(prevLevel[i].GetPosition().x + 0.4, prevLevel[i].GetPosition().y + 0.4, b2Body.b2_staticBody));
        }
        prevLevel = curLevel;
        curLevel = [];
        if (j === levels - 1)
        {
            for(var k = 0; k < prevLevel.length; k++){
                this.createBox(prevLevel[k].GetPosition().x, prevLevel[k].GetPosition().y + 3, .1, 2.5, b2Body.b2_staticBody);
            }
        }    
    }
    this.binBounds = [];
    this.binBounds.push(0);
    for (var i = 0; i < prevLevel.length; i++){
        this.binBounds.push(prevLevel[i].GetPosition().x - 0.05);
    }
    this.binBounds.push(20);
    prevLevel = null;
    curLevel = null;
}

