86.source:
function createBox(x, y, width, height, bodyType) {
    var b2Vec2 = Box2D.Common.Math.b2Vec2
        , b2BodyDef = Box2D.Dynamics.b2BodyDef
        , b2FixtureDef = Box2D.Dynamics.b2FixtureDef
        , b2PolygonShape = Box2D.Collision.Shapes.b2PolygonShape;

    var fixDef = new b2FixtureDef;
    fixDef.density = 1.0;
    fixDef.friction = 0.5;
    fixDef.restitution = 0.2;
    var bodyDef = new b2BodyDef;
    bodyDef.type = bodyType;  
    fixDef.shape = new b2PolygonShape();
    fixDef.shape.SetAsBox(width, height);
    bodyDef.position.x = x;
    bodyDef.position.y = y;
    var a = this.box2dWorld.CreateBody(bodyDef);
    a.CreateFixture(fixDef);
    return a;    
}

89.source:
function analyze() {
    if (this.box2dWorld === null) return;

    for(var body = this.box2dWorld.GetBodyList(); body; body = body.GetNext())
    {
        if (body.m_type === 2) // 2 represents dynamicBody
        {
            for (var j = 0; j < this.binCounts.length; j++)
            {
                if (body.GetPosition().x >= this.binBounds[j] && body.GetPosition().x <= this.binBounds[j+1] && body.GetPosition().y >= 10)
                {
                    this.binCounts[j] += 1;
                    this.box2dWorld.DestroyBody(body);
                }
            }
        }
    }
    this.get("Counts").textString = this.binCounts.toString();
    var max_of_array = Math.max.apply(Math, this.binCounts);

    this.get("Chart").chartGenerator.get('ChartRenderer').submorphs[1].yMaxSlider.value = max_of_array; // submorphs[1] is LinearScales
}

